import React from "react";

const DataPenjualan:React.FC = () => {
  return (
    <div className="tableList">
      <table>
        <thead>
          <tr>
            <th>No</th>
            <th>Nama</th>
            <th>Jumlah</th>
            <th>Harga</th>
            <th>Tanggal</th>
          </tr>
        </thead>
      </table>
    </div>
  )
}


export default DataPenjualan;
